import { useIns, useInsDispatch } from './contexts/CartContext';

import { useUser, useUserDispatch } from './contexts/userContext';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

function TempImg({ imgsrc }) {
    return <img src={imgsrc} width={50} height={50} className="mr-3 mb-3" />;
}
export default function Contact() {
    const { inslen } = useIns();
    const { user, tmpuser } = useUser();
    const { setInstances } = useInsDispatch();
    const { setUser, setTmpuser } = useUserDispatch();
    const handleLogout = () => {
        setUser('');
        setInstances('');
    };
    return (
        <Navbar bg="light" expand="lg">
            <Navbar.Brand href="/">Home</Navbar.Brand>

            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="/about">About</Nav.Link>
                    <Nav.Link href="/">Contact</Nav.Link>
                </Nav>
                <Nav>
                    {!user && <Nav.Link href="/logon">Login</Nav.Link>}
                    {user && <Nav.Link onClick={handleLogout}>LogOut</Nav.Link>}
                    <Nav.Link href="/cart">Cart ({inslen})</Nav.Link>
                    <Nav.Link href="/order">order</Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}
